import { ImgurClient } from 'imgur';

// CommonJS syntax
export const tokenURI = async()=>{
    const client = new ImgurClient({ accessToken: process.env.ACCESS_TOKEN });

    await client.upload('../assets/img/qr_logo.png');
}
